import './Dialogs.css';

function Dialogs() {
	return (
		<div className='dialogs'>
			<div className='dialogs-items'>
				
				<div className='item'>
					Sergey
				</div>
				<div className='item'>
					Dmitriy
				</div>
				<div className='item'>
					Alex
				</div>
			</div>
		</div>
	)
}

export default Dialogs;
